import StateButtons from "../TodoList/StateButtons"
import { v4 as uuidv4 } from 'uuid';

const editItem = (currentTitle, id, e) => {
    console.log(e);
    console.log(currentTitle)
    if (e.keyCode === 13) {
        alert();
    }
    editItem()
}

const TodoList = (props) => {
    let taskElements = props.filtered.map(e => <StateButtons removeItem={props.removeItem} setTodos={props.setTodos} todos={props.todos} setText={props.setText} text={props.text} changeStatus={props.changeStatus} todo={e} editItem={props.editItem} />)
    return (
        <div className="todoList">
            {taskElements.map((task) => {
                return (<div key={uuidv4()}>{task}</div>)
            })}
        </div>
    );
}

export default TodoList;
